/*Table structure for table `tblEmailLog` */

DROP TABLE IF EXISTS `tblEmailLog`;

CREATE TABLE `tblEmailLog` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `ToAddress` varchar(2000) DEFAULT NULL,
  `CCAddress` varchar(2000) DEFAULT NULL,
  `FromAddress` varchar(100) DEFAULT '',
  `Subject` varchar(100) DEFAULT NULL,
  `BodyContent` varchar(20000) DEFAULT NULL,
  `CreatedDate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `MailDeliverDate` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `MailFlag` int(11) DEFAULT '0',
  `BCCAddress` varchar(1000) DEFAULT NULL,
  `MailResponse` varchar(2000) DEFAULT NULL,
  `Category` varchar(100) DEFAULT '',
  PRIMARY KEY (`Id`)
) ENGINE=InnoDB AUTO_INCREMENT=87 DEFAULT CHARSET=latin1;

