/*Table structure for table `tblEnrollCollegeDetails` */

DROP TABLE IF EXISTS `tblEnrollCollegeDetails`;

CREATE TABLE `tblEnrollCollegeDetails` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `CollegeName` int(10) DEFAULT NULL,
  `CollegeCode` varchar(6) DEFAULT NULL,
  `Location` varchar(100) DEFAULT NULL,
  `FacultyName` varchar(120) DEFAULT NULL,
  `Fac_PhoneNum` varchar(25) DEFAULT NULL,
  `Fac_Email` varchar(60) DEFAULT NULL,
  `Student1Name` varchar(120) DEFAULT NULL,
  `Student1Email` varchar(60) DEFAULT NULL,
  `Student1PhoneNum` varchar(25) DEFAULT NULL,
  `Student1Branch` varchar(5) DEFAULT NULL,
  `Student1Year` varchar(15) DEFAULT NULL,
  `Student2Name` varchar(120) DEFAULT NULL,
  `Student2Email` varchar(60) DEFAULT NULL,
  `Student2PhoneNum` varchar(25) DEFAULT NULL,
  `Student2Branch` varchar(5) DEFAULT NULL,
  `Student2Year` varchar(15) DEFAULT NULL,
  `Student3Name` varchar(120) DEFAULT NULL,
  `Student3Email` varchar(60) DEFAULT NULL,
  `Student3PhoneNum` varchar(25) DEFAULT NULL,
  `Student3Branch` varchar(5) DEFAULT NULL,
  `Student3Year` varchar(15) DEFAULT NULL,
  `EnrolledDate` datetime DEFAULT NULL,
  `ModifiedDate` datetime DEFAULT '2016-07-01 08:50:12',
  `Code` varchar(8) DEFAULT NULL,
  `Student4Name` varchar(120) DEFAULT NULL,
  `Student4Email` varchar(60) DEFAULT NULL,
  `Student4PhoneNum` varchar(25) DEFAULT NULL,
  `Student4Branch` varchar(5) DEFAULT NULL,
  `Student4Year` varchar(15) DEFAULT NULL,
  `ModifiedBy` varchar(60) DEFAULT NULL,
  PRIMARY KEY (`id`)
