  `CreatedBy` varchar(60) DEFAULT '',
  `CreatedDate` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `ModifiedBy` varchar(60) DEFAULT '',
  `ModifiedDate` timestamp NULL DEFAULT '2016-01-01 00:00:00',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=37 DEFAULT CHARSET=latin1;

