insert  into `tblTechDetails`(`id`,`topicId`,`title`,`bodyContent`,`videoTutorialLink`,`imagelocation`,`websitelink`,`tutuoriallink`,`bloglink`,`CreatedBy`,`CreatedDate`,`ModifiedBy`,`ModifiedDate`) values (1,4,'Cassandra','<p class=\"methodText\">Apache Cassandra is an open source NoSQL database written in Java, developed by Facebook. It is derived from Google BigTable and Amazon Dynamo DB. Cassandra is a key value store which is used to manage huge amounts of structured, unstructured and semi-structured data in cloud and in Data centers. Cassandra database is distributed over a number of commodity nodes and there is no single point of failure. It also supports ACID properties so that we can use this as a transnational database as well. Cassandra offers continuous availability and linear scale performance.</p><p class=\"methodText\">It uses Cassandra Query Language(CQL) for querying the data, which is very much similar to SQL. Cassandra provides a query prompt called Cassandra Query Language Shell(cqlsh), through which we can create tables, perform CRUD operations on data and much more. The main feature of Cassandra is multi data center replication, in which all the data is replicated to a number of instances of Cassandra. It is built in such a way that any user can connect to any node in any data center to access data. In Cassandra, you can also add new columns and different rows can have different columns.</p>','https://www.youtube.com/embed/B_HTdrTgGNs;https://www.youtube.com/embed/WjjrSjQ2tD4','/usr/local/APCloudFiles/img/casandra.png','http://cassandra.apache.org/','http://www.tutorialspoint.com/cassandra/','https://blogs.apache.org/foundation/tags/cassandra','','2016-09-12 11:36:29','','2016-01-01 00:00:00'),(2,1,'Amazon Webservices','<p class=\"methodText\">Amazon Web Services (AWS), is a subsidiary of Amazon.com, which offers a suite of cloud computing services that makes up an on-demand computing platform. These services operate from 13 geographical regions across the world. The most central and best-known of these services arguably include,Amazon Elastic Compute Cloud, also known as \"EC2\" is used for Compute services.Amazon Simple Storage Service, also known as \"S3\" is for Storage serivce.</p><p class=\"methodText\">AWS now has more than 70 services that span a wide range including compute, storage, networking, database, analytics, application services, deployment, management, mobile, developer tools and tools for the Internet of things. Amazon markets AWS as a service to provide large computing capacity quicker and cheaper than a client company building an actual physical server farm.Amazon is mostly deployed as IAAS and it is a public cloud. Amazon Web Services offers reliable, scalable, and inexpensive cloud computing services. It is free to join, and \"pay only for what you use\".</p>','https://www.youtube.com/embed/Jvg_SsNyR00;https://www.youtube.com/embed/YtwYcpZeoXA?list=PLW2GLKusPL','/usr/local/APCloudFiles/Topics/AWS/logo/amazon.png','http://aws.amazon.com','https://www.lynda.com/AWS-training-tutorials/1536-0.html','http://aws.amazon.com/blogs/aws/','','2016-09-12 11:36:29','vkandregula@miraclesoft.com','2016-09-15 18:52:23'),(3,2,'API Management','<p class=\"methodText\">API Management lets you develop, integrate, secure and manage APIs in a unified way . You need to make sure your service is reliable, secure and well-documented. This is where API Management tools come into play. They provide the means to expose your API to external developers in an easy and affordable manner.</p><p class=\"methodText\">An  API is an architecture that makes it easy for one application to consume capabilities or data from another application.  APIs enable developers to easily access and reuse application logic built by other developers. API Developers can also manage versions of the APIs while deprecating support for older versions. Some of the API Management platforms provide integrations, transformations or API orchestrations.</p><p class=\"methodText\">The main goal of API Management is to make designing, deploying and managing an API easier, and also making sure that it is safe and secure. The leading API Management Platforms are IBM API Connect, Apigee, Layer7, WSO2 etc..</p>','https://www.youtube.com/embed/T9nwR4OrHnk;https://www.youtube.com/embed/Im69kzhpR3I?list=PLhBgTdAWkx','/usr/local/APCloudFiles/img/ibm_api_management.png','http://www-03.ibm.com/software/products/en/api-connect','https://www.ibm.com/support/knowledgecenter/SSWHYP_4.0.0/com.ibm.apimgmt.apionprem.doc/;','https://developer.ibm.com/apiconnect/blog/','','2016-09-12 11:36:29','','2016-01-01 00:00:00'),(4,3,'Apigee','<p class=\"methodText\">Apigee offers a complete solution for moving business to the digital world. Apigee is the leading provider of API technology and services for enterprises and developers. Apigee contains Apigee EDGE which is API management platform. Apigee EDGE platform is used to design, secure, analyze, and scale APIs.  Apigee\'s business model is selling the Apigee Enterprise platform to enterprise API providers. Apigee LINK is part of the Apigee platform which is useful to grow IoT Ecosystem. The enterprise product is used for functions such as API analytics, developer portal and keys, API rate limiting and traffic shaping, OAuth and API security, API transformations.</p><p class=\"methodText\">Apigee Edge enables you  to build APIs and if you have APIs already, expose them directly, while adding a  management and visibility layer. Apigee INSIGHTS have predictive analytics to ensure intelligent and customized interactions. If you have HTTP enabled services, such as SOA-based Web services, they can also be exposed as APIs via Apigee Edge. You expose APIs on Apigee Edge by implementing API proxies.  Apigee is used simplify the delivery, management and analysis of APIs and applications. Behind every smartphone, mobile app and connected experience is at least one API- and APIs need to managed, secured, analyzed and scaled. Apigee EDGE is also useful to build Applications faster. It develops consumable APIs for partners and developers to securely access back-end applications services.</p>','https://www.youtube.com/embed/LssHa1Y_i0g;https://www.youtube.com/embed/RzFicvO79Nk?list=PL0pr08Cuwh','/usr/local/APCloudFiles/img/APIGEE.png','http://apigee.com/about/','http://docs.apigee.com/','http://apigee.com/about/blog','','2016-09-12 11:36:29','','2016-01-01 00:00:00'),(5,5,'Cloudera','<p class=\"methodText\">Cloudera Inc is an American based company that provides a tool which contains Open source Hadoop Distributions and its own set of components that deals with Bigdata related challenges. It give us a manager tool to monitor Hadoop cluster and the status of the current working process. It came up with two types of distributions that is CDH(Cloudera Distribution for Apache Hadoop) Express and CDH Enterprise. </p><p class=\"methodText\">The CDH contains major Apache Hadoop projects like Hadoop(Core), Hive, Flume , Sqoop, Pig, Hbase, Accumulo, Kafka, etc. and its own projects like Cloudera Impala and Cloudera Search. These Components are used for different purposes in Hadoop and we can access all these tools UI in a web browser. We can also get BI (Business Intelligence) capabilities through Hue. With the help of Hue, we can analyze data which is there in HDFS, Hive and Hbase.</p>','https://www.youtube.com/embed/IvtyruO4dN4;https://www.youtube.com/embed/x2wnE8ZTgyI','/usr/local/APCloudFiles/img/cloudera.png','www.cloudera.com','http://www.cloudera.com/developers/get-started-with-hadoop-tutorial/exercise-1.html','http://blog.cloudera.com/?_ga=1.248306436.2056768726.1467125537','','2016-09-12 11:36:29','','2016-01-01 00:00:00'),(6,7,'IBM Bluemix','<p class=\"methodText\">IBM Bluemix is the IBM open cloud platform that provides mobile and web developers access to IBM software for integration, security, transaction, and other key functions, as well as software from business partners. Built on Cloud Foundry open source technology, Bluemix makes application development easier with Platform as a Service (PaaS). And provides pre-built Mobile Backend as a Service (MBaaS) capabilities. The goal is to simplify the delivery of an app by providing services that are ready for immediate use and hosting capabilities to enable internet scale development.</p><p class=\"methodText\">Bluemix is a place for developer to go and to quickly create, deploy and manage applications in the cloud without dealing with underlying infrastructure. Can go to bluemix.net and create free trail account. We have minimal amount of services, runtimes that we can use in free trail. Bluemix is built on Cloud Foundry. Cloud Foundry is an open source Cloud platform.</p><p class=\"methodText\">You can develop mobile apps in iOS, Android, and HTML with JavaScript. You can also migrate existing apps to Bluemix and use the runtimes that Bluemix provides to run your apps.Bluemix also provides middleware services for your apps to use. In general, you don\'t have to worry about the operating system and infrastructure layers when running apps on Bluemix. </p>','https://www.youtube.com/embed/dzOrFeqHeuY;https://www.youtube.com/embed/MtBdbaCQV8A','/usr/local/APCloudFiles/img/IBM-bluemix.png','http://www.ibm.com/cloud-computing/bluemix/','http://www.ibm.com/developerworks/learn/cloud/bluemix/services/index.html','https://developer.ibm.com/bluemix/blog/','','2016-09-12 11:36:29','','2016-01-01 00:00:00'),(7,6,'GAE','<p class=\"methodText\">App Engine is paas for building scalable web apps and mobile backends It is a platform for building highly reliailable applications. Here you have to focus on writing the code no need to worry about server,cluster,infrastructure.It has Traffic splitting, Autoscaling features. It support various programming languages like Java, Python, PHP, Go, Ruby (beta) and Node.js (beta) or bring your own app runtime.</p>','https://www.youtube.com/embed/bfgO-LXGpTM;https://www.youtube.com/embed/s1g4H4-MSJg','/usr/local/APCloudFiles/img/gae.png','https://console.cloud.google.com/start','https://cloud.google.com/appengine/docs/java/gettingstarted/creating-guestbook','https://cloudplatform.googleblog.com/','','2016-09-12 11:36:29','','2016-01-01 00:00:00'),(8,14,'Angular.js','<p class=\"methodText\">AngularJS is a JavaScript framework. It is a library written in JavaScript. AngularJS provides developers options to write client side application (using JavaScript) in a clean MVC (Model View Controller) way. Application written in AngularJS is cross-browser compliant. It automatically handles JavaScript code suitable for each browser. It is an open source, completely free, and used by thousands of developers around the world.</p><p class=\"methodText\">AngularJs is a powerful Javascript framework for building dynamic web applications. It became insanely popular nowadays. The good thing about Angular is that it has a set of ready-to-use modules to simplify building of single page applications.Single page application (SPA) is a web application that fits on a single page. All your code (JS, HTML, CSS) is retrieved with a single page load. And navigation between pages performed without refreshing the whole page.</p>','https://www.youtube.com/embed/k4qVkWh1EAo;https://www.youtube.com/embed/WqmeI5fZcho','/usr/local/APCloudFiles/img/Angular.png','https://angularjs.org/','http://www.w3schools.com/angular/','http://angularjs.blogspot.in/','','2016-09-12 11:36:29','','2016-01-01 00:00:00'),(9,8,'Microsoft Azure','<p class=\"methodText\">Microsoft Azure is a cloud computing platform and infrastructure created by Microsoft for building, deploying, and managing applications and services through a global network of Microsoft-managed data centers. Any developer or IT professional can be productive with Azure. The integrated tools, pre-built templates and managed services make it easier to build and manage enterprise, mobile, Web and Internet of Things (IoT) apps faster, using skills you already have and technologies you already know.</p><p class=\"methodText\">Azure, which easily integrates with your existing IT environment through the largest network of secure private connections, hybrid database and storage solutions and data residency and encryption features — so your assets stay right where you need them. With Azure Stack, you can bring the Azure model of application development and deployment to your datacenter. Azure’s pay-as-you-go services can quickly scale up or down to match demand, so you only pay for what you use. Azure runs on a worldwide network of Microsoft-managed datacenters across 26 regions—more countries and regions than Amazon Web Services and Google Cloud combined.</p>','https://www.youtube.com/embed/ZNgvZE0MLeo;https://www.youtube.com/embed/WKt1NATtaRg','/usr/local/APCloudFiles/img/Microsoft-azure.png','https://azure.microsoft.com/en-in/','http://www.tutorialspoint.com/microsoft_azure/;http://www.tutorialspoint.com/microsoft_azure/','https://azure.microsoft.com/en-in/blog/','','2016-09-12 11:36:29','','2016-01-01 00:00:00'),(10,9,'MongoDb','<p class=\"methodText\">MongoDB is an open-source schemaless Document Oriented database in NoSQL database written in c++. It has the features like Sharding (load balanacing), replication (High Availability) and Backup which helps us to protect the data when a server fails or crashes.  </p><p class=\"methodText\">MongoDB works on concepts of collections and documents. The data is stored in documents in JSON like format called BSON, hence it is called document oriented database. These documents are in turn stored in a collection. We can say that Collections in MongoDB are equvalent to tables in RDBMS and documents in MongoDB are equvalent to rows in RDBMS. The purpose to build MongoDB is scalability, performance, high availability. This is used mainly to store Bigdata and unstructured data which is coming from different sources like web servers, e-commerce sites, etc.</p><p class=\"methodText\">The places where we can use MongoDB - Big Data, Content Management and Delivery, Mobile and Social Infrastructure, User Data Management, Data Hub. We can also embed multiple documents without using complex joins.</p>','https://www.youtube.com/embed/W-WihPoEbR4;https://www.youtube.com/embed/liQzIsFnCr0','/usr/local/APCloudFiles/img/mongodb.png','https://www.mongodb.com/','http://www.tutorialspoint.com/mongodb/','http://blog.mongodb.org/','','2016-09-12 11:36:29','','2016-01-01 00:00:00'),(11,10,'Node.js','<p class=\"methodText\">Node.js is an open-source, cross-platform runtime environment for developing server-side web applications which is built on Chrome\'s V8 JavaScript engine.An easy way to develop scalable network applciations.NPM(Node package manager) runs through command line, used to install node_modules easily using npm install [node_module]. It supports Asynchronous and and Non-Bloking I/O. Can create our own http server using Nodejs. 287k with a growth rate of 344/day node moudles in NPM registery. 293k repositories in github.</p><p class=\"methodText\">Asynchronous and Event Driven - serves each request in a evented loop that can able to handle simultaneous requests.</p><p class=\"methodText\">Very Fast - Build on chrome\'s V8 engine which is having JIT compiler</p><p class=\"methodText\">Single Threaded - Takes all the requests as single thread</p><p class=\"methodText\">No Buffering - Outputs the data in chunks</p><p class=\"methodText\">Scalability - Horizantal scaling, that can add servers to load balance</p><p class=\"methodText\">CallBacks - to implement and process requests and response in Asynchronous</p>','https://www.youtube.com/embed/pU9Q6oiQNd0;https://www.youtube.com/embed/czmulJ9NBP0','/usr/local/APCloudFiles/img/nodejs.png','https://nodejs.org/en/','http://www.tutorialspoint.com/nodejs/','https://nodejs.org/en/blog/','','2016-09-12 11:36:29','','2016-01-01 00:00:00'),(12,11,'Openstack',' <p class=\"methodText\">OpenStack is a open source software platform for cloud computing, mostly deployed as an Infrastructure as a service. It provides both public cloud and private cloud services. The OpenStack platform consists of different components like Nova, Glance, Swift etc., that control hardware pools of processing, storage and networking resources through out a datacenter. The OpenStack is managed by two ways, through web based dashboard and through command line tools. There are different releases of OpenStack, out of which the latest release is \"Mitaka\".</p> <p class=\"methodText\">We can deploy OpenStack by using various automated tools like Chef, Puppet, Ansible etc.Rackspace is one of the biggest companies which offers OpenStack\'s public cloud offerings.The most central services of OpenStack include,Nova, which is used as a compute service Cinder, Swift which are used for block storage and object storage respectively.</p>','https://www.youtube.com/embed/WgJAMQyFCzA;https://www.youtube.com/embed/Qz5gyDenqTI','/usr/local/APCloudFiles/img/Open-Stack.png','https://www.openstack.org/','https://www.openstack.org/software/start/','http://www.openstack.org/blog/','','2016-09-12 11:36:29','','2016-01-01 00:00:00'),(13,12,'Redis','<p class=\"methodText\">Redis (REmote DIctionary Server) is a data structure server developed by Pivotal Software and VMware.It can be written in C,Java,R,PHP and other languages and it works on the platforms like Linux,OS X. Redis database follows Key-value data structure .Redis uses strings,hashes,lists,sets,sorted sets inorder to store the data.We can perform string appending,incrementing values into hash like operations on it. It is one of the most popular NoSQL databases.Redis operates as a single process and is single-threaded. Therefore, a single Redis instance cannot utilize parallel execution of tasks.</p><p class=\"methodText\">Redis supports master-slave asynchronous replication and has features like Transactions Pub/Sub,Lua scripting,Keys with a limited time-to-live,LRU eviction of keys,Automatic failover and features like in-memory computing,ability to store and manipulate high-level datatypes makes Redis to differ from other Key-value databases.Twitter,GitHub,Stackoverflow and other well-known companies are using Redis.</p>','https://www.youtube.com/embed/nSW4xaQ4eEI;https://www.youtube.com/embed/CoQcNgfPYPc','/usr/local/APCloudFiles/img/Redis.png','http://redis.io/','http://www.tutorialspoint.com/redis/','https://redislabs.com/blog','','2016-09-12 11:36:29','','2016-01-01 00:00:00'),(14,13,'Hadoop','<p class=\"methodText\">Apache Hadoop is an open source software framework for storing and processing Big Data on clusters of commodity hardware. The core of the Hadoop consists of Hadoop Distributed File System(HDFS) and MapReduce. HDFS can store data of any format and can handle very large files easily. MapReduce uses parallel processing technique which helps in gaining output much faster than the output that we get by using traditional processing methods.</p><p class=\"methodText\">Hadoop\'s light-weight structure makes it easy to install and flexible to work with. Hadoop can be installed in three ways -  Single Node mode, Pseudo-distributed mode and Fully distributed mode. As Hadoop runs on a cluster of commodity hardware, Hadoop is a cost effective, scalable and reliable solution for Big Data. The Hadoop Ecosystem consists of Apache Open source projects like Hive, Pig, Sqoop, Hbase, Flume, Kafka, etc. which servers different purposes. Hadoop is also available as distributions from Cloudera, Hortonworks, MapR, etc which provide Hadoop and some it\'s Ecosystem\'s components as a whole package.</p>','https://www.youtube.com/embed/nLzOtJWWrrw;https://www.youtube.com/embed/9s-vSeWej1U','/usr/local/APCloudFiles/img/logo_hadoop.png','http://hadoop.apache.org/','https://developer.yahoo.com/hadoop/tutorial/module1.html','http://hadoopblog.blogspot.in/','','2016-09-12 11:36:29','','2016-01-01 00:00:00'),(15,15,'Express.js','<p class=\"methodText\">ExpressJS is one of the most well known packages or Framework for Node.js. It is a web and Mobile development framework that helps us create the great applications. Express is a minimal and flexible Node.js web application framework that provides a robust set of features for web and mobile applications using JavaScript.</p><p class=\"methodText\">We can use Express to build Single-page, multi-page, and hybrid mobile and web apps.We can perform Common back-end functions for web applications.We can create APIs (application programming interfaces).</p><p class=\"methodText\">Express comes with two templating engines, Jade and EJS, which helps the flow of data into a website structure. Express supports the Model-View-Controller(MVC) architecture, a really helpful way to build websites in a model-driven format. It  is  cross-platform, so it’s not limited to one OS. The Express Generator lets you create complex applications quickly, as it can create a default folder structure or a default templete for Appliation development.</p>','https://www.youtube.com/embed/OlapNW9Jc8s;https://www.youtube.com/embed/K4PpZc7AiHI?list=PLGquJ_T_JBMTpKQptCmBDM9HcYrptCV0Z','/usr/local/APCloudFiles/img/express-js.png','http://expressjs.com/','http://www.tutorialspoint.com/nodejs/nodejs_express_framework.htm','https://strongloop.com/strongblog/category/express/?_ga=1.175847906.157956568.1467323672','','2016-09-12 11:36:29','','2016-01-01 00:00:00'),(16,16,'Chef','<p class=\"methodText\">Chef is a powerful infrastructue automation tool written in Ruby and Erlang with which we can configure and control the infrastructure. No matters the size it can control and configure ten to hundreds of machines. It does not matter where the infrastructure is whether it could be on cloud, on-premise, hybrid. All the infrastructue can be configured with the help of instructions provided in the form of recipes to the chef-client which will be installed on the infrastructure(Eg: Virutal Machine). The client reads the configurations and verifies whether the configurations are as expected. If the configurations are not as expected then the chef-client will bring them to the expected configurations.</p> <p class=\"methodText\">Chef provides few Ruby gems with which we can test our environments in our local machine before implementing them in production. Chef also provides several other tools like Chef-Analytics, Chef-compliance with which we can observe the changes that has been occoured during the chef-client run, observe the security of our infrastructure. Chef-Habitat provides the feature to move the application along with the dependant runtimes and topologies. It helps an enterprise in reducing cycle times to get more softwares deployed.</p>','https://www.youtube.com/embed/yh9osPQA_-k?list=PLrmstJpucjzWKt1eWLv88ZFY4R1jW8amR;https://www.youtube.com/embed/LTIjUJEehDA','/usr/local/APCloudFiles/img/chef-logo.jpg','https://www.chef.io/chef/','https://learn.chef.io/tutorials/','https://blog.chef.io/','','2016-09-12 11:36:29','','2016-01-01 00:00:00'),(17,17,'Puppet','<p class=\"methodText\">Puppet Enterprise makes it easy to automate the provisioning, configuration and ongoing management of your machines and the software running on them. It can make rapid, repeatable changes and automatically enforce the consistency of systems and devices – across physical and virtual machines, on premise or in the cloud. It helps an enterprise in reducing cycle times to get more softwares deployed. It lets your define a configuration once, and apply it to thousands of machines.</p><p class=\"methodText\">Puppet master is the central hub of activity and process in Puppet Enterprise. Puppet master contains a compile master within which puppet server will be present. Compile master is a place where Puppet code is compiled to create agent catalogs . The puppet agent uses those catalogs from the puppet-server and will run those catalogs on the nodes(VM\'s) and configures them as specified if they are not as expected. The agent will then send the results to the puppet-server and keeps tracking about the nodes.</p>','https://www.youtube.com/embed/73xeSTz8AeA?list=PLtNErhYMkHnEu1_ZHSJt1xF--zU35dRgZ;https://www.youtube.com/embed/k51SY_o9hMo','/usr/local/APCloudFiles/img/puppet-logo.jpg','https://puppet.com/','https://puppet.com/download-learning-vm','https://puppet.com/blog','','2016-09-12 11:36:29','','2016-01-01 00:00:00'),(18,18,'VMware','<p class=\"methodText\">VMware provides cloud and virtualization software and services. VMware\'s desktop software runs on Microsoft Windows, Linux, and Mac OS X. While its enterprise software hypervisors for servers, VMware ESX and VMware ESXi, are bare-metal hypervisors that run directly on server hardware without requiring an additional underlying operating system. The software virtualizes the hardware for a video adapter, a network adapter, and hard disk adapters. In this way, VMware virtual machines become highly portable between computers, because every host looks nearly identical to the guest.</p><p class=\"methodText\">The vCloud Suite, is a VMware product is an integrated offering that brings together VMware’s industry-leading vSphere hypervisor and VMware vRealize Suite multi-vendor hybrid cloud management platform. VMware’s new portable licensing units allow vCloud Suite to build and manage both vSphere-based private clouds as well as multi-vendor hybrid clouds. It also has VMware ESXi (formerly ESX) is an enterprise-class, type-1 hypervisor developed by VMware for deploying and serving virtual computers. As a type-1 hypervisor, ESXi is not a software application that one installs in an operating system (OS); instead, it includes and integrates vital OS components, such as a kernel.</p>','https://www.youtube.com/embed/z2aVFqp0oc8;https://www.youtube.com/embed/kccuObts1ZM','/usr/local/APCloudFiles/img/vmware.png','http://www.vmware.com/in','http://vcloud.vmware.com/using-vcloud-air/tutorials','http://blogs.vmware.com/','','2016-09-12 11:36:29','','2016-01-01 00:00:00'),(19,19,'Cloud Foundry',' <p class=\"methodText\">It is an open source cloud Platform as a Service (PaaS) on which developers can build, deploy, run and scale applications on both public and private cloud models. It is written in Ruby and Go and also supports different languages like Java, Node.js, Go, PHP, Python, Ruby along with different frameworks like grails, spring, rails. It is also used to deploy applications on an Infrastructure as a service ( IaaS ) like OpenStack, VMware and AWS. The different services which use Cloud Foundry platform include Pivotal Web Services (PWS), IBM Bluemix, CenturyLink Cloud. Cloud Foundry gives companies the speed, simplicity and control they need to develop and deploy applications more faster and easier.</p><p class=\"methodText\">Deploying Cloud Foundry involves interfacing with the underlaying infrastructure using the Cloud Foundry BOSH (bosh outer shell) deployment scripting language. The BOSH Director is the core component in BOSH, which controls VM creation and deployment, as well as other software and service lifecycle events. Cloud Foundry has used two architectures for managing application containers- Droplet Execution Agents (DEA), written in Ruby and Diego, written in Go. With the DEA architecture, the Cloud Controller schedules and manages applications on the DEA nodes. In the Diego architecture, Diego components replace some of the DEAs components. Cloud Foundry has an identity management service named as User Account and Authentication (UAA) which acts as an Authorization Server and issues access tokens for applications that request the platform resources.</p>','https://www.youtube.com/embed/KNI2c6yS2Bo;https://www.youtube.com/embed/RC1HX_7aGa8','/usr/local/APCloudFiles/img/cf.png','https://www.cloudfoundry.org/','https://docs.cloudfoundry.org/','https://www.cloudfoundry.org/blog/','','2016-09-12 11:36:29','','2016-01-01 00:00:00'),(20,20,'Google Cloud Platform','<p class=\"methodText\">Google Cloud Platform is a cloud computing platform by Google that offers hosting on the same supporting infrastructure that Google uses internally for end-user products like Google Search and YouTube. Few Components in Google Cloud Platform are App Engine,Compute Engine,etc. Google Cloud Platform Provides services that are computing and hosting services,storage services,etc.</p><p class=\"methodText\">Compute Engine is IaaS which are used to create and run virtual machines on google infrastructure with network-attached and ultra-high performance local storage options, customizable load-balancing and auto-scaling across homogeneous VMs. It Support for the most popular flavors of Linux and Windows operating systems.Preemptible virtual machines for inexpensive batch jobs and fault-tolerant workloads.</p>','https://www.youtube.com/embed/vbJl5O91ZC4;https://www.youtube.com/embed/KzJxwu2poIc','/usr/local/APCloudFiles/img/google-cloud.jpeg','https://cloud.google.com','https://cloud.google.com/docs/tutorials','https://cloudplatform.googleblog.com/','','2016-09-12 11:36:29','','2016-01-01 00:00:00'),(21,21,'Shell Scripting',' <p class=\"methodText\">A shell script is a computer program designed to be run by the Unix shell, a command-line interpreter. The various dialects of shell scripts are considered to be scripting languages. Typical operations performed by shell scripts include file manipulation, program execution, and printing text.</p><p class=\"methodText\">Batch files in Windows, while useful, are a cheap imitation of shell scripts. Shell scripts allow us to program commands in chains and have the system execute them as a scripted event, just like batch files. They also allow for far more useful functions, such as command substitution.</p>','https://www.youtube.com/embed/nVt3Rst-2H8?list=PL7B7FA4E693D8E790;https://www.youtube.com/embed/hwrnmQumtPw','/usr/local/APCloudFiles/img/shell.jpg','http://linuxcommand.org/writing_shell_scripts.php','http://www.tutorialspoint.com/unix/','http://linuxshellscripting.blogspot.in/','','2016-09-12 11:36:29','','2016-01-01 00:00:00'),(22,22,'Github','<p class=\"methodText\">In Traditional system it would be bit difficult to handle multiple contributors work on the same project, i,e multiple contributores may work on same file. This can lead to a number of creative uses which relate to collaboration. It\'s hard for one person to list all sort of Modification and integrating them. So we used Git Hub repository.</p><p class=\"methodText\">Git Hub is an online repository service that any one can sign up for. It uses a technology called \"GIT\" which keeps tracks of revisions.It is used to share, clone(Forking), make Versions and modifying. It is Open source, where programmers can work collaboratively. And it is easy to look and edit the code in GitHub. And Repository is a Central place, used for data storage and Maintains files and DB and provides distribution network through Repositories. </p>','https://www.youtube.com/embed/VUaBfYCmJls;https://www.youtube.com/embed/0fKg7e37bQE','/usr/local/APCloudFiles/img/github.png','https://github.com/','https://guides.github.com/activities/hello-world/','https://github.com/blog/category/engineering','','2016-09-12 11:36:29','','2016-01-01 00:00:00'),(23,23,'Docker','<p class=\"methodText\">Docker is a open platform for developing, shipping and running applications using container virtualization technology. Its containers wrap a piece of software in a complete filesystem that contains everything needed to run: code, runtime, system tools, system libraries – anything that can be installed on a server. This guarantees that the software will always run the same, regardless of its environment. Docker containers are created using docker images. Docker images contains set of instructions to create containers such as what programs to install, what folders and files to create, what port numbers to expose etc.</p><p class=\"methodText\">Docker container can contain one or more images. We can build our own images or we can use the images created by other docker users or we can use standard images from docker hub.Docker platform consists of multiple products/tools such as Docker engine, Docker hub and orchestration tools such as Docker machine, Docker swarm, Docker compose etc.</p>','https://www.youtube.com/embed/Q5POuMHxW-0;https://www.youtube.com/embed/aLipr7tTuA4','/usr/local/APCloudFiles/img/docker.png','https://www.docker.com/','http://prakhar.me/docker-curriculum/','https://blog.docker.com/','','2016-09-12 11:36:29','','2016-01-01 00:00:00'),(24,24,'Unix Commands','<p class=\"methodText\">Unix is a family of multitasking, multiuser computer operating systems. The operating system provides a set of simple tools that each perform a limited, well-defined function, with a unified filesystem as the main means of communication and a shell scripting and command language to combine the tools to perform complex workflows. The entire operating system is written in the C programming language that allowed Unix to reach numerous platforms. Many clones of Unix have arisen over the years, of which Linux is the most popular.</p><p class=\"methodText\">Originally, Unix was meant to be a programmer\'s workbench to be used for developing software to be run on multiple platforms, more than to be used to run application software. Under Unix, the operating system consists of many utilities along with the master control program, the kernel. The kernel provides services to start and stop programs, handles the file system and other common \"low-level\" tasks that most programs share, and schedules access to avoid conflicts when programs try to access the same resource or device simultaneously.</p>','https://www.youtube.com/embed/3DA1grSp4mU;https://www.youtube.com/embed/pYUGzgYAgEo','/usr/local/APCloudFiles/img/unix.png','http://www.unix.org/what_is_unix.html','http://www.tutorialspoint.com/unix/unix-useful-commands.htm','http://unix-commands-blog.blogspot.in/','','2016-09-12 11:36:29','','2016-01-01 00:00:00'),(25,26,'Javascript','<p class=\"methodText\">JavaScript (\"JS\" for short) is client side script language. It is open and cross-platform. It is a dynamic programming language that, when applied to an HTML document, can provide dynamic interactivity on websites. JavaScript is a high-level and interpreted programming language. It has been standardized in the ECMAScript language specification. Alongside HTML and CSS, it is one of the three core technologies of World Wide Web content production. The majority of websites employ it and it is supported by all modern Web browsers without plug-ins.</p><p class=\"methodText\">Client side scripting is code that exists inside the client’s HTML page. This code will be processed on the client machine and the HTML page will NOT perform a PostBack to the web-server. Traditionally, client-side scripting is used for page navigation, data validation and formatting. The language used in this scripting is JavaScript. JavaScript is compatible and is able to run on any internet browser.</p>','https://www.youtube.com/embed/XL9Ri8pO68w;https://www.youtube.com/embed/6MaOPdQPvow','/usr/local/APCloudFiles/img/javascript.png','https://www.javascript.com/','http://www.tutorialspoint.com/javascript/','https://javascriptweblog.wordpress.com/','','2016-09-12 11:36:29','','2016-01-01 00:00:00'),(26,27,'Meanstack','<p class=\"methodText\">The acronym \"MEAN\" stands for MongoDB, ExpressJS, AngularJS, NodeJS\" and represents a group of technologies which are known to synergize well together based on JavaScript. Used for all the client and server sides to databases. MEAN is also known full-stack development toolkit.</p><p class=\"methodText\">That main advantage of the MEAN stack is the ability to write JavaScript code on the front and back ends. This is a biggest challange. Previously, you would have to know multiple languages to create a full stack application. JavaScript is unique in this respect, and adds to its power, usefulness, flexibility, and overall popularity.</p><p class=\"methodText\">MongoDB : For Non-relational database</p><p class=\"methodText\">Express : Node framework that has powerful middleware features.Based on MVC Architecture</p><p class=\"methodText\">Angular : A frontend JavaScript library created and maintained by Google that is used to create single page applications</p><p class=\"methodText\">Node : Server-side JavaScript environment based on V8 Engine</p>','https://www.youtube.com/embed/8CK93h5YJp0;https://www.youtube.com/embed/QM11fHtOriQ?list=PLwUM0lZzgY0nOpDaVVSkYdjNvInvrSb7u','/usr/local/APCloudFiles/img/meanstack.png','http://mean.io/','https://github.com/ericdouglas/MEAN-Learning','http://mean.io/blog/','','2016-09-12 11:36:29','','2016-01-01 00:00:00'),(27,28,'Devops','<p class=\"methodText\">In tradition system Developers need to wait weeks and weeks to deploy there application and in the mean while some computators may introduce new products and features much faster and System admin for operation team has to  Managing too many servers and once uploading is done she should continuous check if any errors or problems caused by changing in source code.So to over come these issues we introduced a Methodology DevOps.</p><p class=\"methodText\">Devops stands for Development and operations.It is a Methodology, which ensures that both developers and operating team work collaboration and integration between software developers and Information Technology(IT) .It Automates Integration, Code testing, workflow, Infrastructure and Deployment.The main goal of Devops</p><p class=\"methodText\"> Improves the collaboration between dev and ops teams.</p><p class=\"methodText\"> Automates Infrastructure and workflow.</p><p class=\"methodText\">And continuous measuring of the application and the performance.</p>','https://www.youtube.com/embed/_I94-tJlovg;https://www.youtube.com/embed/4o99zq77KBE?list=PL9ooVrP1hQOE5ZDJJsnEXZ2upwK7aTYiX','/usr/local/APCloudFiles/img/devops.png','http://devops.com/','https://www.javacodegeeks.com/tutorials/devops-tutorials/','http://devops.com/category/blogs/','','2016-09-12 11:36:29','','2016-01-01 00:00:00'),(28,29,'Cloudant','<p class=\"methodText\">Cloudant is an IBM software product, which is primarily delivered as a cloud-based service.Cloudant is an open source non-relational, distributed database service of the same name that requires zero-configuration.Cloudant is based on the Apache-backed CouchDB project and the open source BigCouch project.Cloudant is  available in IBM Bluemix service and www.cloud.com.</p><p class=\"methodText\">Cloudant provides an HTTP API to your JSON data, and 24-hour operational support and maintenance.Cloudant stores documents using JSON (JavaScript Object Notion) encoding, so anything encoded into JSON can be stored as a document.Files like images, videos, and audio are called BLOBs (binary large objects) and can be stored as attachments within documents.</p>','https://www.youtube.com/embed/8BBN3BWkmMM;https://www.youtube.com/embed/BpQYOn8AVo0','/usr/local/APCloudFiles/img/cloudant1.png','https://cloudant.com','https://docs.cloudant.com/','https://cloudant.com/blog/','','2016-09-12 11:36:29','','2016-01-01 00:00:00'),(29,30,'Ionic','<p class=\"methodText\">Ionic is an HTML5 mobile app development framework targeted at building hybrid mobile apps. Hybrid apps are essentially small websites running in a browser shell in an app that have access to the native platform layer. Hybrid apps have many benefits over pure native apps, specifically in terms of platform support, speed of development, and access to 3rd party code.</p><p class=\"methodText\">Think of Ionic as the front-end UI framework that handles all of the look and feel and UI interactions your app needs in order to be compelling. Kind of like “Bootstrap for Native,” but with support for a broad range of common native mobile components, slick animations, and beautiful design.</p><p class=\"methodText\">Unlike a responsive framework, Ionic comes with very native-styled mobile UI elements and layouts that you’d get with a native SDK on iOS or Android but didn’t really exist before on the web. Ionic also gives you some opinionated but powerful ways to build mobile applications that eclipse existing HTML5 development frameworks.</p><p class=\"methodText\">Since Ionic is an HTML5 framework, it needs a native wrapper like Cordova or PhoneGap in order to run as a native app. We strongly recommend using Cordova proper for your apps, and the Ionic tools will use Cordova underneath.</p>','https://www.youtube.com/embed/OMrAxI5cXm4?list=PLIGDNOJWiL19wVC5EKghMwbSlfF8jZJcB;https://www.youtube.com/embed/JHUIK4Iu7Pc?list=PLIGDNOJWiL19wVC5EKghMwbSlfF8jZJcB&index=2','/usr/local/APCloudFiles/img/ionic_logo1.png','http://ionicframework.com/','http://www.tutorialspoint.com/ionic','http://blog.ionic.io','','2016-09-12 11:36:29','','2016-01-01 00:00:00'),(31,34,'AM   Services','<p class=\"methodText\">Amazon Web Services (AWS), is a subsidiary of Amazon.com, which offers a suite of cloud computing services that makes up an on-demand computing platform. These services operate from 13 geographical regions across the world. The most central and best-known of these services arguably include,Amazon Elastic Compute Cloud, also known as \"EC2\" is used for Compute services.Amazon Simple Storage Service, also known as \"S3\" is for Storage serivce.</p><p class=\"methodText\">AWS now has more than 70 services that span a wide range including compute, storage, networking, database, analytics, application services, deployment, management, mobile, developer tools and tools for the Internet of things. Amazon markets AWS as a service to provide large computing capacity quicker and cheaper than a client company building an actual physical server farm.Amazon is mostly deployed as IAAS and it is a public cloud. Amazon Web Services offers reliable, scalable, and inexpensive cloud computing services. It is free to join, and \"pay only for what you use\".</p>','Https://www.youtube.com/embed/B_HTdrTgGNs;https://www.youtube.com/embed/WjjrSjQ2tD4  ','/usr/local/APCloudFiles/Topics/AWS/logo/Aws.PNG','http://cassandra.apache.org/','http://www.tutorialspoint.com/cassandra/','https://blogs.apache.org/foundation/tags/cassandra','vkandregula@miraclesoft.com','2016-09-12 23:20:19','vkandregula@miraclesoft.com','2016-09-15 16:52:09'),(35,38,'Hibernate','<p class=\"methodText\">\r\nHibernate is a high-performance Object/Relational persistence and query service which is licensed under the open source GNU Lesser General Public License (LGPL) and is free to download. Hibernate not only takes care of the mapping from Java classes to database tables (and from Java data types to SQL data types), but also provides data query and retrieval facilities.\r\n</p>\r\n<p class=\"methodText\">\r\nThis tutorial is designed for Java programmers with a need to understand the Hibernate framework and API. After completing this tutorial you will find yourself at a moderate level of expertise in using Hibernate from where you can take yourself to next levels.\r\n</p>','https://www.youtube.com/embed/Yv2xctJxE-w','/usr/local/ApCloudFiles/Topics/Hibernate/logo/Hibernate.png','http://hibernate.org/','http://www.tutorialspoint.com/hibernate/','https://vladmihalcea.com/tutorials/hibernate/','vkandregula@miraclesoft.com','2016-09-20 15:34:18','vkandregula@miraclesoft.com','2016-09-20 15:34:52'),(36,39,'Spring Tutorial','<p class=\"method\">\r\nSpring is a lightweight framework. It can be thought of as a framework of frameworks because it provides support to various frameworks such as Struts, Hibernate, Tapestry, EJB, JSF etc. The framework, in broader sense, can be defined as a structure where we find solution of the various technical problems\r\n</p>\r\n\r\n<p class=\"method\">\r\nThe Spring framework comprises several modules such as IOC, AOP, DAO, Context, ORM, WEB MVC etc. We will learn these modules in next page. Let\'s understand the IOC and Dependency Injection first.\r\n</p>','https://www.youtube.com/embed/-weKK-oNuhA;https://www.youtube.com/embed/-weKK-oNuhA','/usr/local/APCloudFiles/Topics/Spring/logo/Spring.png','https://spring.io/','http://www.javatpoint.com/spring-tutorial','https://spring.io/blog','vkandregula@miraclesoft.com','2016-09-20 16:24:16','','2016-01-01 00:00:00');

