/* Procedure structure for procedure `spEmailLog` */

/*!50003 DROP PROCEDURE IF EXISTS  `spEmailLog` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`AppCloud`@`%` PROCEDURE `spEmailLog`(
	IN  frmId	INT,
 	in  frmTypeId   int 
)
BEGIN
DECLARE bodyContent VARCHAR(20000);
DECLARE subject1 VARCHAR(100);
DECLARE type1 VARCHAR(20);
DECLARE v_email VARCHAR(60);
DECLARE result VARCHAR(500);	
DECLARE done INTEGER DEFAULT 0; 
 IF (frmTypeId!= 5) THEN
			
BEGIN
 DECLARE Cur1 CURSOR FOR   SELECT Email FROM tblRegistrationDetails WHERE ProfessionType=frmTypeId;  
 DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;
 SET result = '';
 
 OPEN Cur1;
  
 
 REPEAT
	FETCH Cur1 INTO v_email;
	
	SET result = done;
	
	SELECT SUBJECT ,Body,TYPE INTO subject1,bodyContent,type1 FROM tblNotifications WHERE id=frmId;
	INSERT INTO tblEmailLog
         (
        `ToAddress`, 
	`CCAddress`, 
	`FromAddress`, 
	`Subject`, 
	`BodyContent`, 
	`CreatedDate`, 
	`MailDeliverDate`,
	`MailFlag`, 
	`BCCAddress`, 
	`MailResponse`, 
	`Category`	
         )
    VALUES 
         ( 
           v_email, 
           '' , 
           '' , 
           subject1, 
           bodyContent, 
           NOW(),
	   NOW(),
	   0,	
           '',
	   '',
           type1
         ) ; 
	
	IF NOT done THEN
	
	SET result = '';
	END IF;
	SET result = '';
	UNTIL done END REPEAT;	
	CLOSE Cur1;  
	
 END;
 end if;
 	
	if (frmTypeId = 5) then 
	begin
	
	DECLARE Cur2 CURSOR FOR   SELECT Email FROM tblCoachDetails;  
 DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;
 SET result = '';
 
 OPEN Cur2;
  
 
 REPEAT
	FETCH Cur2 INTO v_email;
	
	SET result = done;
	
	SELECT SUBJECT ,Body,TYPE INTO subject1,bodyContent,type1 FROM tblNotifications WHERE id=frmId;
	INSERT INTO tblEmailLog
         (
        `ToAddress`, 
	`CCAddress`, 
	`FromAddress`, 
	`Subject`, 
	`BodyContent`, 
	`CreatedDate`, 
	`MailDeliverDate`,
	`MailFlag`, 
	`BCCAddress`, 
	`MailResponse`, 
	`Category`	
         )
    VALUES 
         ( 
           v_email, 
           '' , 
           '' , 
           subject1, 
           bodyContent, 
           NOW(),
	   NOW(),
	   0,	
           '',
	   '',
           type1
         ) ; 
	
	IF NOT done THEN
	
	SET result = '';
	END IF;
	SET result = '';
	UNTIL done END REPEAT;	
	CLOSE Cur2;  
	
	
	end;
	end if;
         END */$$
DELIMITER ;

/* Procedure structure for procedure `spEnrollCollDetails` */

/*!50003 DROP PROCEDURE IF EXISTS  `spEnrollCollDetails` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`AppCloud`@`%` PROCEDURE `spEnrollCollDetails`(
	IN frmCode                        VARCHAR(20),
        IN  frmCollegeName                INT, 
        IN  frmCollegeCode                VARCHAR(6), 
        IN  frmLocation                   VARCHAR(100), 
        
        IN  frmFacultyName                VARCHAR(120), 
        IN  frmFac_PhoneNum               VARCHAR(25),
        IN  frmFac_Email                  VARCHAR(60), 
        IN  frmStudent1Name               VARCHAR(120), 
        IN  frmStudent1Email              VARCHAR(60),
	IN  frmStudent1PhoneNum           VARCHAR(25),
	IN  frmStudent1Branch          	  VARCHAR(25),
	IN  frmStudent1Year         	  VARCHAR(20),
		
	IN  frmStudent2Name               VARCHAR(120),
	IN  frmStudent2Email              VARCHAR(60),
	IN  frmStudent2PhoneNum           VARCHAR(25),
	IN  frmStudent2Branch          	  VARCHAR(25),
	IN  frmStudent2Year         	  VARCHAR(20),
	
	IN  frmStudent3Name               VARCHAR(120),
	IN  frmStudent3Email              VARCHAR(60),
	IN  frmStudent3PhoneNum           VARCHAR(25),
	IN  frmStudent3Branch          	  VARCHAR(25),
	IN  frmStudent3Year         	  VARCHAR(20),
	
	IN  frmStudent4Name               VARCHAR(120),
	IN  frmStudent4Email              VARCHAR(60),
	IN  frmStudent4PhoneNum           VARCHAR(25),
	IN  frmStudent4Branch          	  VARCHAR(25),
	IN  frmStudent4Year         	  VARCHAR(20),
	IN  frmEnrolledDate               DATETIME ,
	IN  frmPassword                   VARCHAR(100), 
	IN  frmtype			  VARCHAR(20),
	IN  frmId                            INT(11),
	IN  frmModifiedBy                 VARCHAR(60)
    )
BEGIN    
	DECLARE frmProfessionType VARCHAR(20);
	 IF (frmtype = 'Insert')     THEN
	INSERT INTO `apcloud`.`tblEnrollCollegeDetails` 
	(
	`code`,
	`CollegeName`, 
	`CollegeCode`, 
	`Location`, 	 
	`FacultyName`, 
	`Fac_PhoneNum`, 
	`Fac_Email`, 
	`Student1Name`, 
