/* Procedure structure for procedure `spEnrollTopics` */

/*!50003 DROP PROCEDURE IF EXISTS  `spEnrollTopics` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`AppCloud`@`%` PROCEDURE `spEnrollTopics`(
    
    IN sp_userId        INT,
    IN sp_workshopCode   VARCHAR(100),
    IN sp_topicId       VARCHAR(100),
    IN sp_allTopics     VARCHAR(50)
 )
BEGIN
	
	DECLARE v_id INT;
	DECLARE V_total INTEGER DEFAULT 0;
	DECLARE v_workshopCode VARCHAR(100);
	DECLARE v_topicsList VARCHAR(100);
	
	SELECT COUNT(workshopCode) INTO V_total FROM tblEnrolledWorkshopTopics WHERE registredId= sp_userId AND workshopCode=sp_workshopCode;
	
	IF (V_total>0) THEN
		IF (sp_allTopics='single') THEN
			SELECT enrolledTopicsList INTO v_topicsList FROM tblEnrolledWorkshopTopics WHERE registredId=sp_userId AND workshopCode=sp_workshopCode;
	
			SET v_topicsList = CONCAT_WS(',',v_topicsList,sp_topicId);
		ELSE
				SELECT sp_topicId INTO v_topicsList;
		END IF;
		
		UPDATE tblEnrolledWorkshopTopics SET enrolledTopicsList=v_topicsList WHERE registredId=sp_userId AND workshopCode=sp_workshopCode;
	
	ELSE
		INSERT INTO tblEnrolledWorkshopTopics (  registredId, workshopCode, enrolledTopicsList)	VALUES( sp_userId, sp_workshopCode, sp_topicId);
		
	
	END IF;
	
    END */$$
DELIMITER ;

/* Procedure structure for procedure `spGetWorshopStatistics` */

/*!50003 DROP PROCEDURE IF EXISTS  `spGetWorshopStatistics` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`AppCloud`@`%` PROCEDURE `spGetWorshopStatistics`(
	
	
	OUT CollegeNames VARCHAR(1000),
	OUT TopicNames VARCHAR(1000),
	OUT CountList VARCHAR(1000)
    )
BEGIN  
	DECLARE done INT DEFAULT 0;
	
	DECLARE v_CollegeName VARCHAR(100);
	DECLARE v_TopicNames VARCHAR(100);
	DECLARE v_TopicNames1 VARCHAR(1000);
	DECLARE v_WorkShopCode VARCHAR(20);
	DECLARE v_CountList1 VARCHAR(100);
	DECLARE v_CountList INT;
	DECLARE Cur1 CURSOR FOR SELECT tblLKCollegesList.CollegeName,tblWorkshop.CODE  FROM tblWorkshop JOIN tblLKCollegesList ON (tblWorkshop.CollegeName=tblLKCollegesList.id);
	
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;
	
	OPEN Cur1;
	
	REPEAT
		FETCH Cur1 INTO 
		v_CollegeName,
		v_WorkShopCode;
	
	IF NOT done THEN
			
		SET v_CollegeName=CONCAT('(',v_WorkShopCode,') ',v_CollegeName);
		SET CollegeNames   = CONCAT_WS('|',CollegeNames,v_CollegeName);
		SET v_TopicNames1=null;
		SET v_CountList1=null;
		
		BLOCK2: BEGIN
			DECLARE done2 INT DEFAULT 0;
			
			DECLARE Cur2 CURSOR FOR SELECT tblLKTopics.TopicName ,COUNT(tblEnrolledWorkshopTopics.enrollTopics) FROM tblEnrolledWorkshopTopics JOIN tblLKTopics ON (tblEnrolledWorkshopTopics.enrollTopics = tblLKTopics.id) where workshopCode = v_WorkShopCode GROUP BY tblEnrolledWorkshopTopics.enrollTopics;
	
				DECLARE CONTINUE HANDLER FOR NOT FOUND SET done2 = 1;
				OPEN Cur2;
	
			REPEAT
				FETCH Cur2 INTO 
					v_TopicNames,
					v_CountList;
			IF NOT done2 THEN
				SET v_TopicNames1   = CONCAT_WS('^',v_TopicNames1,v_TopicNames);
				SET v_CountList1  = CONCAT_WS('^',v_CountList1,v_CountList);
			END IF;
			UNTIL done2 END REPEAT;	
			
			CLOSE Cur2;
		
		END BLOCK2;
		-- IF(LENGTH(`v_CountList1`),`v_CountList1`,' ')
		SET TopicNames   = CONCAT_WS('|',TopicNames,IF(LENGTH(`v_TopicNames1`),`v_TopicNames1`,'no data'));
		SET CountList   = CONCAT_WS('|',CountList,IF(LENGTH(`v_CountList1`),`v_CountList1`,'no data'));
		
	END IF;
	
	UNTIL done END REPEAT;	
	CLOSE Cur1;
	
    END */$$
DELIMITER ;

/* Procedure structure for procedure `spGetWorshopStatistics_1` */

/*!50003 DROP PROCEDURE IF EXISTS  `spGetWorshopStatistics_1` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`AppCloud`@`%` PROCEDURE `spGetWorshopStatistics_1`(
	
	
	OUT CollegeNames VARCHAR(1000),
	OUT TopicNames VARCHAR(1000),
	OUT CountList VARCHAR(1000)
    )
BEGIN  
	DECLARE done INT DEFAULT 0;
	
	DECLARE v_CollegeName VARCHAR(100);
	DECLARE v_TopicNames VARCHAR(100);
	DECLARE v_TopicNames1 VARCHAR(1000);
	DECLARE v_WorkShopCode VARCHAR(20);
	DECLARE v_CountList1 VARCHAR(100);
	DECLARE v_CompanyOrCollegeName VARCHAR(100);	
	DECLARE v_CountList INT;
	DECLARE Cur1 CURSOR FOR SELECT tblLKCollegesList.CollegeName,tblWorkshop.CollegeName AS CompanyOrCollegeName,tblWorkshop.CODE  FROM tblWorkshop LEFT JOIN tblLKCollegesList ON (tblWorkshop.CollegeName=tblLKCollegesList.id);
	
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;
	
	OPEN Cur1;
	
	REPEAT
		FETCH Cur1 INTO 
		v_CollegeName,
		v_CompanyOrCollegeName,
		v_WorkShopCode;
		SET v_TopicNames1=NULL;
		SET v_CountList1=NULL;
	IF NOT done THEN
			
		IF v_CollegeName IS NOT NULL then 
	
		SET v_CollegeName=CONCAT('(',v_WorkShopCode,') ',v_CollegeName);
		SET CollegeNames   = CONCAT_WS('|',CollegeNames,v_CollegeName);
		
		end if;
	
		if v_CollegeName is null then 
	
		SET v_CompanyOrCollegeName=CONCAT('(',v_WorkShopCode,') ',v_CompanyOrCollegeName);
		SET CollegeNames   = CONCAT_WS('|',CollegeNames,v_CompanyOrCollegeName);
		
		END IF;
		BLOCK2: BEGIN
			DECLARE done2 INT DEFAULT 0;
			
			DECLARE Cur2 CURSOR FOR SELECT tblLKTopics.TopicName ,COUNT(tblEnrolledWorkshopTopics.enrollTopics) FROM tblEnrolledWorkshopTopics JOIN tblLKTopics ON (tblEnrolledWorkshopTopics.enrollTopics = tblLKTopics.id) where workshopCode = v_WorkShopCode GROUP BY tblEnrolledWorkshopTopics.enrollTopics;
	
				DECLARE CONTINUE HANDLER FOR NOT FOUND SET done2 = 1;
				OPEN Cur2;
	
			REPEAT
				FETCH Cur2 INTO 
					v_TopicNames,
					v_CountList;
			IF NOT done2 THEN
				SET v_TopicNames1   = CONCAT_WS('^',v_TopicNames1,v_TopicNames);
				SET v_CountList1  = CONCAT_WS('^',v_CountList1,v_CountList);
			END IF;
			UNTIL done2 END REPEAT;	
			
			CLOSE Cur2;
		
		END BLOCK2;
		-- IF(LENGTH(`v_CountList1`),`v_CountList1`,' ')
		SET TopicNames   = CONCAT_WS('|',TopicNames,IF(LENGTH(`v_TopicNames1`),`v_TopicNames1`,'no data'));
		SET CountList   = CONCAT_WS('|',CountList,IF(LENGTH(`v_CountList1`),`v_CountList1`,'no data'));
		
	END IF;
	
	UNTIL done END REPEAT;	
	CLOSE Cur1;
	
    END */$$
DELIMITER ;

/* Procedure structure for procedure `spInsertRegDetails` */

/*!50003 DROP PROCEDURE IF EXISTS  `spInsertRegDetails` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`AppCloud`@`%` PROCEDURE `spInsertRegDetails`(
 	IN  frmFName                      VARCHAR(60), 
        IN  frmLName                      VARCHAR(60), 
        IN  frmEmail                      VARCHAR(60), 
        IN  frmPassword                   VARCHAR(100), 
        IN  frmPhoneNum                   VARCHAR(25), 
        IN  frmProfessionType             VARCHAR(3),
        IN  frmCollege                    VARCHAR(60), 
	IN  frmFaceBookLink               VARCHAR(100),
	IN  frmBranch                     VARCHAR(60), 
	IN  frmYear                       VARCHAR(30),
        IN  frmStreet                     VARCHAR(150),
        IN  frmCity                       VARCHAR(30), 
        IN  frmDistrict                   VARCHAR(30), 
        IN  frmZipCode                    VARCHAR(6),
        IN  frmState  			  VARCHAR(20),
        IN  frmCreatedDate                DATETIME,
	IN  frmDesig                      VARCHAR(60), 
	OUT maxId			  INT (10)
     )
BEGIN
DECLARE isAmbassador	INT DEFAULT 0;
INSERT INTO tblRegistrationDetails
         (
        `FName`, 
	`LName`, 
	`Email`, 
	`Password`, 
	`PhoneNum`, 
	`ProfessionType`, 
	`Designation`,
	`FaceBookLink`,
	`Branch`,
	`Year`, 
	`College`, 
	
	`Street`, 
	`City`, 
	`District`, 
	`ZipCode`, 
	`State`,
	`CreatedDate`
         )
    VALUES 
         ( 
           frmFName, 
           frmLName , 
           frmEmail , 
           frmPassword, 
           frmPhoneNum, 
           frmProfessionType,
	   frmDesig,
	   frmFaceBookLink,	
	   frmBranch,
	   frmYear,	
           frmCollege,
	  
           frmStreet,
	   frmCity,
	   frmDistrict,
	   frmZipCode,
	   frmState,
	   frmCreatedDate
         ) ; 
 SELECT LAST_INSERT_ID() INTO maxId;	
 
 
 SELECT COUNT(id) INTO isAmbassador FROM tblEnrollCollegeDetails WHERE Fac_Email=frmEmail OR Student1Email=frmEmail OR Student2Email=frmEmail OR Student3Email=frmEmail OR Student4Email=frmEmail ;
 IF isAmbassador > 0 THEN
 UPDATE tblRegistrationDetails SET IsAmbassador=1 WHERE id=maxId;
 END IF;
 IF frmProfessionType = '2' THEN
 UPDATE tblRegistrationDetails SET CompanyName=frmCollege WHERE id=maxId;
 END IF;
 
 
 -- select max(id) from tblRegistrationDetails into maxId;
-- SET @maxId = LAST_INSERT_ID(); 
    END */$$
DELIMITER ;

/* Procedure structure for procedure `spLogin` */

/*!50003 DROP PROCEDURE IF EXISTS  `spLogin` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`AppCloud`@`%` PROCEDURE `spLogin`(
    
    IN  frmEmail                VARCHAR(120),
    
    OUT frmResponse		VARCHAR(1000)
 )
BEGIN
	
	DECLARE v_id INT;
	DECLARE V_total INTEGER DEFAULT 0;
	DECLARE v_email VARCHAR(100);
	DECLARE v_fname VARCHAR(100);
	DECLARE v_lname VARCHAR(100);
	DECLARE v_pwd VARCHAR(100);
	DECLARE v_enrollworkshops VARCHAR(100);
	DECLARE v_phonenum VARCHAR(25);
	DECLARE v_collegeName VARCHAR(60);
	DECLARE v_professionType VARCHAR(60);
	DECLARE v_college VARCHAR(60);	
	SELECT COUNT(*) INTO V_total FROM tblRegistrationDetails WHERE Email= frmEmail;
	
	IF (V_total>0) THEN
	
	SELECT tblRegistrationDetails.id,tblRegistrationDetails.Email, tblRegistrationDetails.FName, tblRegistrationDetails.LName, tblRegistrationDetails.PASSWORD, tblRegistrationDetails.PhoneNum, tblLKCollegesList.CollegeName,tblRegistrationDetails.ProfessionType,tblRegistrationDetails.College, tblRegistrationDetails.EnrolledWorkshopIds INTO v_id,v_email, v_fname, v_lname, v_pwd, v_phonenum, v_collegeName,v_professionType,v_college,v_enrollworkshops FROM tblRegistrationDetails LEFT JOIN tblLKCollegesList ON (tblLKCollegesList.Id=tblRegistrationDetails.College) WHERE Email= frmEmail;
	
      IF  v_professionType = 2 THEN
		SELECT v_college INTO v_collegeName;
	         
			 END IF;
  
 SET frmResponse = CONCAT_WS('^',v_id,v_email,v_fname,v_lname,v_pwd,v_phonenum,v_collegeName,v_professionType,v_enrollworkshops);
	
	ELSE
	SET frmResponse='nouser';
	
	END IF;
	
    END */$$
DELIMITER ;

