/* Procedure structure for procedure `spTopicsInsertorUpdate` */

/*!50003 DROP PROCEDURE IF EXISTS  `spTopicsInsertorUpdate` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`AppCloud`@`%` PROCEDURE `spTopicsInsertorUpdate`(
	
	in frmTopicName VARCHAR(100),
	in frmImageUrl VARCHAR(100),
	in frmExamId int(10),
	in frmStatus VARCHAR(10), 
	in frmBodyContent VARCHAR(9000), 
	in frmVideoTutorialLink VARCHAR(500), 
	in frmWebsitelink VARCHAR(100), 
	in frmTutuoriallink VARCHAR(500), 
	in frmBloglink VARCHAR(100), 
	in frmCreatedBy VARCHAR(60),
	in frmCreatedDate TIMESTAMP,
	IN frmtype VARCHAR(10),
	In frmTitle VARCHAR(100),
	IN frmTopicId INT(10),
	OUT genTopicId Int(10)
 
    )
BEGIN  
	DECLARE v_id INT;
	DECLARE v_maxId VARCHAR(10);
	IF (frmtype = 'Insert')     THEN
	INSERT INTO tblLKTopics	( TopicName  ,  ImageUrls , ExamId , STATUS , CreatedBy , CreatedDate)	
	VALUES	
	( 
	frmTopicName,
	frmImageUrl,
	frmExamId,
	frmStatus,
	frmCreatedBy,
	frmCreatedDate
	   );	
	SELECT LAST_INSERT_ID() INTO v_id;
	SET genTopicId = v_id;
	INSERT INTO `tblTechDetails` 
	(
	`topicId`, 
	`title`, 
	`bodyContent`, 
	`videoTutorialLink`, 
	`imagelocation`, 
	`websitelink`, 
	`tutuoriallink`, 
	`bloglink`, 
	`CreatedBy`, 
	`CreatedDate`
	)
	VALUES
	(
	v_id, 
	frmTitle, 
	frmBodyContent, 
	frmVideoTutorialLink, 
	frmImageUrl, 
	frmWebsitelink, 
	frmTutuoriallink, 
	frmBloglink, 
	frmCreatedBy,
	frmCreatedDate
	);
	
	ELSE
		IF (frmtype = 'Update') THEN
			UPDATE `tblLKTopics` 
	SET
	
	`TopicName` = frmTopicName , 
	`ImageUrls` = frmImageUrl , 
	`ExamId` = frmExamId , 
	`Status` = frmStatus , 
	`ModifiedBy` = frmCreatedBy , 
	`ModifiedDate` = frmCreatedDate
	
	WHERE
	`id` = frmTopicId ;
	
	
UPDATE `tblTechDetails` 
	SET
	 
	`title` = frmTitle , 
	`bodyContent` = frmBodyContent , 
	`videoTutorialLink` = frmVideoTutorialLink , 
	`imagelocation` = frmImageUrl , 
	`websitelink` = frmWebsitelink , 
	`tutuoriallink` = frmTutuoriallink , 
	`bloglink` = frmBloglink , 
	`ModifiedBy` = frmCreatedBy , 
	`ModifiedDate` = frmCreatedDate
	
	WHERE
	`topicId` = frmTopicId ;
		END IF;
	
	END IF;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `spWorkshopAddEdit` */

/*!50003 DROP PROCEDURE IF EXISTS  `spWorkshopAddEdit` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`AppCloud`@`%` PROCEDURE `spWorkshopAddEdit`(
	
	IN frmDate DATE,
	IN frmCollegeName VARCHAR(100),
	IN frmLocation VARCHAR(300),
	IN createdBy VARCHAR(100),
	IN createdDate TIMESTAMP,
	IN frmtype VARCHAR(10),
	IN workshopId VARCHAR(10),
	IN workshopType INT,
	IN frmStatus varchar(15),
	OUT workshopCode VARCHAR(10)
 
    )
BEGIN  
	DECLARE v_id INT;
	DECLARE v_maxId VARCHAR(10);
	IF (frmtype = 'Insert')     THEN
	INSERT INTO `tblWorkshop` 
	( 
	`Date`, 
	`CollegeName`, 
	`Location`, 
	`CreatedBy`, 
	`CreatedDate`,
	`WorkshopType`,
	`Status`
	
	)
	VALUES
	( 
	 
	frmDate, 
	frmCollegeName, 
	frmLocation, 
	createdBy, 
	createdDate,
	workshopType,
	frmStatus
	
	);	
	SELECT LAST_INSERT_ID() INTO v_id;
	SET v_maxId = CONCAT('W',v_id);
	UPDATE `tblWorkshop` SET CODE=v_maxId WHERE id=v_id;
	SET workshopCode = v_maxId;
	ELSE
		IF (frmtype = 'Update') THEN
			UPDATE `apcloud`.`tblWorkshop` 
	SET
	`Date` = frmDate , 
	`Location` = frmLocation , 
	`ModifiedBy` = createdBy , 
	`ModifiedDate` = createdDate,
	`Status` = frmStatus
	
	WHERE
	`Code` = workshopId ;
		END IF;
	END IF;
    END */$$
DELIMITER ;

